<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8">
    <title>Page Not Found</title>
    <script type="text/javascript">
      // Single Page Apps for GitHub Pages
      // MIT License
      // https://github.com/rafgraph/spa-github-pages
      // This script checks to see if a redirect is already in place
      // If so, it removes the redirect and sets the path to the route we want to go to
      // If not, it sets the path to the route we want to go to
      (function(){var path=window.location.pathname;var query=window.location.search;var hash=window.location.hash;if(path.length>1&&path.endsWith("/")){window.location.replace(path.slice(0,-1)+query+hash);return}if(path.length>1&&!path.includes(".")){var segment=path.split("/")[1];if(segment&&!segment.includes(".")){window.history.replaceState(null,null,path.slice(1)+query+hash);return}}var match=window.location.search.match(/\?p=(.*)/);var decoded=match?decodeURIComponent(match[1]):"";if(decoded){window.history.replaceState(null,null,decoded+window.location.hash)}})();
    </script>
  </head>
  <body>
  </body>
</html>
